Description: 
Daring Pure! brings you &quot;First Summer Love&quot;. 
The temperature isn`t the only thing heating up out here. 
Days are longer, nights are shorter and love is in the air. 
The passion that these lovers bring is as hot as the burning sun - it's their 'First Summer Love'. 
There is nothing like the rush of a steamy uninhibited summer romance under a bright blue skye! 
Please enjoy!
